import React from "react";

function Optic_Map() {
  const map = new ol.Map({
    target: "map",
    layers: [
      new ol.layer.Tile({
        source: new ol.source.OSM()
      })
    ],
    view: new ol.View({
      center: ol.proj.fromLonLat([37.41, 8.82]),
      zoom: 4
    })
  });
  return <div className="Optic_Map" id="map"></div>;
}

export default Optic_Map;
